    false,nt"url": null,nt"notes": "The TIGER/Line shapefilesn          and
    related database files (.dbf) are an extract of selected geographic and cartographicn
             information from the U.S. Census Bureau's Master Address File / Topologically
    Integratedn          Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB).
    The MTDB represents an          seamless national file with no overlaps or gaps
    between parts, however, each TIGER/Linen          shapefile is designed to stand
    alone as an independent data set, or they can be combinedn          to cover the
    entire nation. Face refers to the areal (polygon) topological primitives thatn          make
    up MTDB. A face is bounded by one or more edges; its boundary includes only the
    edgesn          that separate it from other faces, not any interior edges contained
    within the area of then          face. The Topological Faces Shapefile contains
    the attributes of each topologicaln          primitive face. Each face has a unique
    topological face identifier (TFID) value. Each facen          in the shapefile includes
    the key geographic area codes for all geographic areas for whichn          the Census
    Bureau tabulates data for both the 2010 Census and the annual estimates andn          surveys.
    The geometries of each of these geographic areas can then, be built by dissolvingn
             the face geometries on the appropriate key geographic area codes in the
    Topological Facesn          Shapefile.",nt"license_title": null,nt"extras":
